import React, {useState} from "react";
import {Button} from "./Button";

export const Counter = () => {
    let[counter, setCounter] = useState(0)
    const upCounter = () => {
        setCounter(+1)

    }
    const resetCounter = () => {
       setCounter(0)
    }
    return(
        <div>
            <>{counter}</>
            <Button callBack={upCounter} name={"add"}/>
            <Button callBack={resetCounter} name={"reset"}/>

        </div>
    )

}
